(5, 'For reset password', '<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n<meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge,chrome=1\">\n<meta name=\"format-detection\" content=\"telephone=no\"> <!-- disable auto telephone linking in iOS -->\n<title></title>\n<link href=\"https://fonts.googleapis.com/css?family=Roboto\" rel=\"stylesheet\">\n<style>\n	html,\n	body,\n	p {\n		font-family: \'Roboto\', sans-serif;\n		font-size: 14px;\n	}\n</style>\n<table style=\"display: table;border-collapse: separate;box-sizing: border-box;\" border=\"0\" width=\"100%\" align=\"center\">\n	<tbody>\n		<tr>\n			<td>\n				<table\n					style=\"border: 1px solid #c9d6df;border-radius:20px;box-sizing: border-box;border-collapse: collapse; border: 1px solid #d1c7c7 !important;background-color: #fff;\"\n					border=\"1\" width=\"600\" align=\"center\">\n					<tbody>\n						<tr>\n							<td>\n								<table\n									style=\"display: table;border-collapse: separate;box-sizing: border-box;box-sizing: border-box;border-collapse: collapse;\"\n									border=\"0\" align=\"center\" width=\"100%\">\n									<tbody>\n										<tr>\n											<td style=\"padding: 15px;/* height: 50px; */background-color: #efefef;border-bottom: 1px solid #bfbfbf;\">\n												<center> \n													<img src=\"http://tms.dosina.no/assets/img/logo.png\" class=\"img-full\" alt=\"...\" style=\"max-height: 50px;width: 250px;\"> \n												</center>\n											</td>\n										</tr>\n										<!--<tr>-->\n										<!--<td><span style=\"height: 1px;width: 100%;background-color: #d1c7c7;display: block;\">&nbsp;</span></td>-->\n										<!--</tr>-->\n										<tr>\n											<td style=\"padding: 15px;\">\n												<p>Hi [USERNAME],</p>\n												<hr>\n												<p>You recently requested to reset your password for your account at Dosina Translations. &nbsp;</p>\n												<p>Please click on the link below to reset your password: </p>\n												[RESETPASSWORDLINK]<br><br>\n												If you did not request this reset, please ignore this email.<br><br>\n												Kind regards,<br>\n												Dosina Translations @ TMS.\n											</td>\n										</tr>\n										<tr>\n											<td\n												style=\"padding: 5px;background-color: #efefef;border-top: 1px solid #b5b5b5;\">\n												<center>\n													<div style=\"text-align: left;\">\n														<span><em>For more information, visit us at \n															<a style=\"color: #000000;\"\n																	href=\"https://www.dosinatranslations.no\"><u>www.dosinatranslations.no</u></a>\n																<em></span>\n													</div>\n													<div> </div><br>\n													<div style=\"text-align: left;\">\n														<span><em>\n															This email and any attachments to it may be confidential and are intended solely for the use of the individual to whom it is addressed. If you are not the intended recipient of this email, you must neither take any action based upon its contents, nor copy or show it to anyone. If you have received this transmission in error, please use the reply function to tell us and then permanently delete what you have received.\n														</em></span>\n													</div>\n													<div> </div>\n													<div> </div>\n												</center>\n											</td>\n										</tr>\n									</tbody>\n								</table>\n							</td>\n						</tr>\n					</tbody>\n				</table>\n			</td>\n		</tr>\n	</tbody>\n</table>', 'Reset your password | Dosina Translation', 3, 1, 1, '2018-09-08 14:57:11', '2024-04-23 17:49:19'),
(6, 'For Accepted job by resource', '<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n<meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge,chrome=1\">\n<meta name=\"format-detection\" content=\"telephone=no\"> <!-- disable auto telephone linking in iOS -->\n<title></title>\n<link href=\"https://fonts.googleapis.com/css?family=Roboto\" rel=\"stylesheet\">\n<style>\n	html,\n	body,\n	p {\n		font-family: \'Roboto\', sans-serif;\n		font-size: 14px;\n	}\n</style>\n<table style=\"display: table;border-collapse: separate;box-sizing: border-box;\" border=\"0\" width=\"100%\" align=\"center\">\n	<tbody>\n		<tr>\n			<td>\n				<table style=\"border: 1px solid #c9d6df;border-radius:20px;box-sizing: border-box;border-collapse: collapse; border: 1px solid #d1c7c7 !important;background-color: #fff;\" border=\"1\" width=\"600\" align=\"center\">\n					<tbody>\n						<tr>\n							<td>\n								<table style=\"display: table;border-collapse: separate;box-sizing: border-box;box-sizing: border-box;border-collapse: collapse;\" border=\"0\" align=\"center\" width=\"100%\">\n									<tbody>\n										<tr>\n											<td style=\"padding: 15px;/* height: 50px; */background-color: #efefef;border-bottom: 1px solid #bfbfbf;\">\n												<center> <img src=\"https://tms.dosina.no/assets/img/logo.png\" class=\"img-full\" alt=\"...\" style=\"max-height: 50px;width: 250px;\"> </center>\n											</td>\n										</tr>\n										<tr>\n											<td style=\"padding: 15px;\">\n												<p><span>Hi!<br></span></p>\n\n												<div><span>I would like to let you know that I\'m happy to accept the\n														job.</span></div>\n												<div><span> </span></div>\n												<div>\n													<span><b>JOB</b></span><br><span>[JOBNO]</span><br><br><span><b>LANGUAGES</b></span><br><span>[LANGUAGES]</span><br><br><span><b>RESOURCE</b></span><br><span>[RESOURCENAME]</span>\n												<